Based on the provided document, the primary cause of the $585 million decrease in operating revenues for the year ended December 31, 2023, compared to 2022, is:

**D: Increase in North Carolina IMR**

The document states in the "PIEDMONT" section under "Year Ended December 31, 2023, as compared to 2022" that the variance in operating revenues was driven primarily by:

- a $585 million decrease due to lower natural gas costs passed through to customers, lower volumes, and decreased off-system sales natural gas costs.
- Partially offset by:
  - a $26 million increase due to customer growth;
  - a $19 million increase due to North Carolina IMR;
  - an $11 million increase due to Tennessee ARM revenue recognition;
  - a $9 million increase due to secondary marketing sales.

The decrease in operating revenues is primarily attributed to lower natural gas costs passed through to customers, lower volumes, and decreased off-system sales natural gas costs. However, the document also mentions that the decrease was partially offset by an increase in North Carolina IMR, which indicates that the increase in North Carolina IMR played a role in mitigating the decrease in operating revenues. Therefore, the correct answer is D: Increase in North Carolina IMR.
